import styled from 'styled-components';

const About = () => {
  return (
    <AboutWrapper>
      <h1>About</h1>
      <p>This is a Gatsby starter blog with TypeScript and styled-components.</p>
    </AboutWrapper>
  );
};

const AboutWrapper = styled.div`
  max-width: 960px;
  margin: 0 auto;
  padding: 0 1rem;
`;

export default About;
